import React, { Component } from 'react';
import "./style.css"

class Menu extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return (
        <div className="nav-menu">
            <div href="#" className="menu"><button>{this.props.children}</button></div>
        </div> 
        );
    }
}

export default Menu;
